import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useParams, Link } from 'react-router-dom';
import jsPDF from 'jspdf';
import 'jspdf-autotable';
import './PaginaDetalleFactura.css';

const PaginaDetFac = () => {
    const { id } = useParams();
    const [factura, setFactura] = useState(null);


    const generarPDF = async () => {
            const doc = new jsPDF();
    
            // Título
            doc.setFontSize(18);
            doc.text(`Factura`, 14, 22);
    
            doc.setFontSize(10);
            doc.text('Fecha        : ' + new Date(factura.fecha_orden).toLocaleDateString('es-CL'), 84, 20);

            doc.text(`N° de factura: ${factura.numero_orden}`, 84, 25);
        
            // Subtítulo
            doc.setFontSize(14);
            doc.text('Datos proveedor', 14, 33);
        
            // Información de la empresa
            doc.setFontSize(12);
            doc.text(`Razón Social: ${factura.razon_social_proveedor}`, 14, 40);
            doc.text(`RUT: ${factura.rut_proveedor}`, 14, 46);
            doc.text(`Dirección: ${factura.direccion_proveedor}`, 14, 52);
            doc.text(`Teléfono: ${factura.telefono_proveedor}`, 14, 58);
            doc.text(`Correo: ${factura.correo_proveedor}`, 14, 64);
        
            // Subtítulo
            doc.setFontSize(14);
            doc.text('Datos cliente', 14, 74);
        
            // Datos del cliente
            doc.setFontSize(12);
            doc.text(`Razón Social/Nombre: ${factura.nombre_cliente}`, 14, 80); // Ajusta los valores de y según donde quieras que aparezca la información del cliente
            doc.text(`RUT: ${factura.rut_cliente}`, 14, 86);
            doc.text(`Dirección: ${factura.direccion_cliente}`, 14, 92);
            doc.text(`Teléfono: ${factura.telefono_cliente}`, 14, 98);
            doc.text(`Correo: ${factura.correo_cliente}`, 14, 104);
            
    
            
    
        
    
    
        // Add image
        const imgData = 'data:image/jpeg;base64,'; // Replace with your image data
        doc.addImage(imgData, 'JPEG', 150, 5, 60, 60); // Adjust coordinates and dimensions as needed
    
        
    
        // Encabezado de la tabla
        // Encabezado de la tabla de productos
        const tableColumn = ["Nombre del Producto", "Cantidad", "Precio Unitario", "Total por Producto"];
        const tableRows = [];
    
        // Datos de la tabla de productos
        productos.forEach(producto => {
            const precio = parseFloat(producto.precio) || 0;
            const total = parseFloat(producto.total) || 0;
            const productoData = [
                producto.nombre,
                producto.cantidad,
                `$${precio.toFixed(2)}`,
                `$${total.toFixed(2)}`,
            ];
            tableRows.push(productoData);
        });
    
        // Generar la tabla de productos
        const startYProductos = 112;
        const marginTable = 10;
        const pageHeight = doc.internal.pageSize.height;
        const maxYProductos = pageHeight - marginTable - (tableRows.length * 10);
        doc.autoTable({
            head: [tableColumn],
            body: tableRows,
            startY: startYProductos,
            margin: { top: marginTable },
            theme: 'grid',
        });
    
        // Información de la factura
        const startYFacturaInfo = doc.autoTable.previous.finalY + marginTable;
        const invoiceInfoColumns = ["", ""];
        const invoiceInfoRows = [
            ["Subtotal", new Intl.NumberFormat('es-CL', { style: 'currency', currency: 'CLP' }).format(factura.subtotal)],
            ["IVA (19%)", new Intl.NumberFormat('es-CL', { style: 'currency', currency: 'CLP' }).format(factura.iva)],
            ["Total General", new Intl.NumberFormat('es-CL', { style: 'currency', currency: 'CLP' }).format(factura.total)],
        ];
    
        // Generar la información de la factura
        doc.autoTable({
            head: [invoiceInfoColumns],
            body: invoiceInfoRows,
            startY: startYFacturaInfo,
            margin: { top: marginTable },
            theme: 'plain',
            styles: { halign: 'center' },
        });
    
        // Información de despacho
        const despachoText = `Datos de despacho:
        Región: ${factura.regionDespacho}
        Comuna: ${factura.comunaDespacho}
        Dirección: ${factura.direccionDespacho}
        Fecha de entrega estimada: ${new Date(factura.fechaDespacho).toLocaleDateString()}`;
    
        // Calcular la altura necesaria para el texto de despacho
        const splitDespachoText = doc.splitTextToSize(despachoText, 100);
        const despachoTextHeight = splitDespachoText.length * 5;
    
        // Imprimir la información de despacho al final del documento
        doc.text(splitDespachoText, 14, pageHeight - marginTable - despachoTextHeight);
    
        // Guardar el PDF
        doc.save('factura.pdf');
        
    
        
    };

    

    useEffect(() => {
        const fetchFactura = async () => {
            try {
                const response = await axios.get(`http://localhost:3001/api/factura/${id}`);
                const facturaData = response.data;
                
                // Parsea la propiedad productos si es una cadena JSON
                if (typeof facturaData.productos === 'string') {
                    facturaData.productos = JSON.parse(facturaData.productos);
                }
                
                setFactura(facturaData);
            } catch (error) {
                console.error('Error al obtener los detalles de la factura:', error.message, error.response?.data);
            }
        };
    
        if (id) {
            fetchFactura();
        }
    }, [id]);
    
    if (!factura) {
        return <div>Cargando...</div>;
    }

    const handleClick = () => {
        const url = `http://localhost:3001/api/factura/evidencia/${factura.numero_orden}`;
        window.open(url, '_blank'); // Abre la URL en una nueva pestaña
      };

    

    const baseUrl = '../Assets/'; // Ajusta según la estructura real de tu proyecto
    const imagenEvidencia = `${baseUrl}${factura.foto_evidencia}`;

    const imgdos = '../Assets/foto_evidencia-1720052993609-724889080.jpg'

    const productos = Array.isArray(factura.productos) ? factura.productos : [];

    return (
        <div className='detalle-container'>
            <Link to='/home'>
                <button className='btn-volver'>
                    <svg height="16" width="16" xmlns="http://www.w3.org/2000/svg" version="1.1" viewBox="0 0 1024 1024"><path d="M874.690416 495.52477c0 11.2973-9.168824 20.466124-20.466124 20.466124l-604.773963 0 188.083679 188.083679c7.992021 7.992021 7.992021 20.947078 0 28.939099-4.001127 3.990894-9.240455 5.996574-14.46955 5.996574-5.239328 0-10.478655-1.995447-14.479783-5.996574l-223.00912-223.00912c-3.837398-3.837398-5.996574-9.046027-5.996574-14.46955 0-5.433756 2.159176-10.632151 5.996574-14.46955l223.019353-223.029586c7.992021-7.992021 20.957311-7.992021 28.949332 0 7.992021 8.002254 7.992021 20.957311 0 28.949332l-188.073446 188.073446 604.753497 0C865.521592 475.058646 874.690416 484.217237 874.690416 495.52477z"></path></svg>
                    <span>Volver</span>
                </button>
            </Link>
            <h1>Detalles de la Factura N° {factura.numero_orden}</h1>
            <table>
                <tbody>
                    <tr>
                        <th>Número de Factura:</th>
                        <td>{factura.numero_orden}</td>
                    </tr>
                    <tr>
                        <th>Fecha de Factura:</th>
                        <td>{new Date(factura.fecha_orden).toLocaleDateString('es-ES', { year: 'numeric', month: 'long', day: 'numeric' })}</td>
                    </tr>
                    <tr>
                        <th>Estado de la factura:</th>
                        <td>{factura.estado_factura}</td>
                    </tr>
                </tbody>
            </table>
            
            <h2>Datos del proveedor</h2>
            <table>
                <tbody>
                    <tr>
                        <th>Rut:</th>
                        <td>{factura.rut_proveedor}</td>
                    </tr>
                    <tr>
                        <th>Razón social:</th>
                        <td>{factura.razon_social_proveedor}</td>
                    </tr>
                    <tr>
                        <th>Dirección:</th>
                        <td>{factura.direccion_proveedor}</td>
                    </tr>
                    <tr>
                        <th>Teléfono:</th>
                        <td>+56{factura.telefono_proveedor}</td>
                    </tr>
                    <tr>
                        <th>Correo:</th>
                        <td>{factura.correo_proveedor}</td>
                    </tr>
                    <tr>
                        <th>Sitio web:</th>
                        <td>{factura.sitio_web_proveedor}</td>
                    </tr>
                    <tr>
                        <th>Tipo de servicio:</th>
                        <td>{factura.tipo_servicio}</td>
                    </tr>
                </tbody>
            </table>
            <h2>Datos del cliente</h2>
            <table>
                <tbody>
                    <tr>
                        <th>Rut:</th>
                        <td>{factura.rut_cliente}</td>
                    </tr>
                    <tr>
                        <th>Nombre/Razón social:</th>
                        <td>{factura.nombre_cliente}</td>
                    </tr>
                    <tr>
                        <th>Dirección:</th>
                        <td>{factura.direccion_cliente}</td>
                    </tr>
                    <tr>
                        <th>Teléfono:</th>
                        <td>{factura.telefono_cliente}</td>
                    </tr>
                    <tr>
                        <th>Correo:</th>
                        <td>{factura.correo_cliente}</td>
                    </tr>
                </tbody>
            </table>
            <h2>Productos de la factura</h2>
            <table>
                <thead>
                    <tr>
                        <th>Nombre</th>
                        <th>Precio Unitario</th>
                        <th>Cantidad</th>
                        <th>Total</th>
                    </tr>
                </thead>
                <tbody>
                    {productos.map((producto, index) => (
                        <tr key={index}>
                            <td>{producto.nombre}</td>
                            <td>{Number(producto.precio).toLocaleString('es-CL', { style: 'currency', currency: 'CLP' })}</td>
                            <td>{producto.cantidad}</td>
                            <td>{Number(producto.total).toLocaleString('es-CL', { style: 'currency', currency: 'CLP' })}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
            <h2>Detalles del despacho</h2>
            <table>
                <tbody>
                    <tr>
                        <th>Región:</th>
                        <td>{factura.regionDespacho}</td>
                    </tr>
                    <tr>
                        <th>Comuna:</th>
                        <td>{factura.comunaDespacho}</td>
                    </tr>
                    <tr>
                        <th>Dirección:</th>
                        <td>{factura.direccionDespacho}</td>
                    </tr>
                    <tr>
                        <th>Fecha estimada de entrega:</th>
                        <td>{new Date(factura.fechaDespacho).toLocaleDateString('es-ES', { year: 'numeric', month: 'long', day: 'numeric' })}</td>
                    </tr>
                    <tr>
                        <th>Estado del despacho:</th>
                        <td>{factura.estado_entrega}</td>
                    </tr>

                    {/* Condicional para mostrar la razón de rechazo si el estado de entrega es 'rechazada' */}
                    {factura.estado_entrega === 'rechazada' && (
                        <tr>
                            <th>Razón de Rechazo:</th>
                            <td>{factura.motivo_rechazo}</td>
                            
                        </tr>
                    )}

                    {factura.estado_entrega === 'entregada' && (
                        <>
                            <tr>
                                <th>Dirección de Entrega:</th>
                                <td>{factura.direccion_entrega}</td>
                            </tr>
                            <tr>
                                <th>Rut de Persona que Recibió:</th>
                                <td>{factura.rut_receptor}</td>
                            </tr>
                            
                            <tr>
                                <th>Imagen:</th>
                                
                                <button onClick={handleClick}>Ver imagen</button>
                                
                            </tr>
                                
                        </>
                    )}
                </tbody>
            </table>

            <h2>Montos</h2>
            <table>
                <tbody>
                    <tr>
                        <th>Subtotal:</th>
                        <td>{Number(factura.subtotal).toLocaleString('es-CL', { style: 'currency', currency: 'CLP' })}</td>
                    </tr>
                    <tr>
                        <th>IVA:</th>
                        <td>{Number(factura.iva).toLocaleString('es-CL', { style: 'currency', currency: 'CLP' })}</td>
                    </tr>
                    <tr>
                        <th>Total General:</th>
                        <td>{Number(factura.total).toLocaleString('es-CL', { style: 'currency', currency: 'CLP' })}</td>
                    </tr>
                </tbody>
            </table>
            <button className='btn-rectificar' style={{marginBottom: '50px'}} onClick={generarPDF}>Descargar pdf</button>
            <Link to={`/rectificar/${id}`}>
                <button className='btn-rectificar' style={{marginBottom: '50px'}}>
                    Hacer rectificaciones
                </button>
            </Link>
            <button className='btn-rectificar' style={{marginBottom: '50px'}} onClick={generarPDF}>Anular factura</button>
            
        </div>
    );
};

export default PaginaDetFac;
